const Joblist=({firstname,state,address,lastname,pnumber})=>{



        return(
            <div style={{border:"1px solid black"}}>
              <p>Address: {address}</p>
              <p>firstname: {firstname}</p>
              <p>lastname:{lastname}</p>
              <p>Phone Number: {pnumber}</p>
              <p>state: {state}</p>
            </div>
          )






}

export default Joblist;
